import React from 'react'
import Link from 'next/link'

function MainPage(){

    return(
        <div>
            <h1>Notes</h1>

            <Link href="/notes">
                <a>Notes</a>
            </Link>
        </div>
    )
}

export async function getServerSideProps() {
    const res = await fetch(`http://localhost:3000/api/note/`)
    const {data} = await res.json()

    console.log(data)
    return {
      props: {notes: data}
    }
  }


export default MainPage
